import React, { Component } from "react";
import CB from "./CB.jsx";

class CBS extends Component {
  state = {
    CB: [
      { id: 1, user: 1, rembut: 0, idx: 1 },
      { id: 2, user: 2, rembut: 0, idx: 1 }
    ]
  };
  render() {
    return (
      <div>
        {this.state.CB.map(tag => (
          <CB key={CB.id} idx={CB.idx} user={CB.user} />
        ))}
      </div>
    );
  }
}

export default CBS;
